import React from "react";
import UserList from "../components/UserList";

const images = require.context('../../img/profile_picture', true)
const imagePath = (name) => images(name, true)

// then within your component
console.log(imagePath('./user.png')) // it's relative to context

const Match = () => {
  const USER = [
    {
      key: "1",
      name: "Obama",
      image: "okok",
      placeCount: "5",
      id: "U1"
    },
    {
      key: "2",
      name: "Julie",
      image: "http://localhost:3000/client/src/img/profile_picture/julie.jpg",
      placeCount: "5",
      id: "U2"
    }
  ];

  return <UserList items={USER} />;
};
export default Match;
